// frontend/src/pages/Dashboard.js
import React, { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';
import AdminDashboard from './AdminDashboard';
import TeacherDashboard from './TeacherDashboard';
import StudentDashboard from './StudentDashboard';
import ParentDashboard from './ParentDashboard';
import Loading from '../components/Loading';
import './Dashboard.css';

const Dashboard = () => {
  const { user, loading } = useAuth();
  const [dashboardData, setDashboardData] = useState(null);

  useEffect(() => {
    if (user) {
      // Fetch dashboard data based on user role
      fetchDashboardData();
    }
  }, [user]);

  const fetchDashboardData = async () => {
    try {
      // This would be your API call to get dashboard data
      const data = {
        user: user,
        lastLogin: new Date().toISOString(),
        notifications: [],
        stats: {}
      };
      setDashboardData(data);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    }
  };

  const renderDashboardByRole = () => {
    if (!user) return null;

    switch (user.role) {
      case 'admin':
        return <AdminDashboard />;
      case 'teacher':
        return <TeacherDashboard />;
      case 'student':
        return <StudentDashboard />;
      case 'parent':
        return <ParentDashboard />;
      default:
        return <DefaultDashboard user={user} />;
    }
  };

  if (loading) {
    return <Loading />;
  }

  return (
    <div className="dashboard">
      {renderDashboardByRole()}
    </div>
  );
};

// Default dashboard for unrecognized roles
const DefaultDashboard = ({ user }) => {
  return (
    <div className="default-dashboard">
      <div className="dashboard-header">
        <h1>Welcome, {user.name}!</h1>
        <p>Your account type: {user.role}</p>
      </div>
      
      <div className="dashboard-content">
        <div className="welcome-card">
          <h2>Getting Started</h2>
          <p>Welcome to the Exam Management System. Please contact your administrator for proper role assignment.</p>
        </div>
        
        <div className="quick-actions">
          <h3>Available Actions</h3>
          <div className="action-grid">
            <a href="/profile" className="action-card">
              <i className="fas fa-user"></i>
              <h4>My Profile</h4>
              <p>View and edit your profile information</p>
            </a>
            
            <a href="/settings" className="action-card">
              <i className="fas fa-cog"></i>
              <h4>Settings</h4>
              <p>Manage your account settings</p>
            </a>
            
            <a href="/help" className="action-card">
              <i className="fas fa-question-circle"></i>
              <h4>Help & Support</h4>
              <p>Get help and support</p>
            </a>
            
            <a href="/contact" className="action-card">
              <i className="fas fa-envelope"></i>
              <h4>Contact Us</h4>
              <p>Get in touch with our team</p>
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
